import styled from "styled-components";
import dashboard from "../../images/dashboard.svg";
import courses from "./courses.svg";
import { Flex } from "../../defaultStyles";

export const Wrapper = styled.div`
    position: absolute;
    width: 256px;
    height: 770px;
    left: 0px;
    top: 80px;
    background: #292C3E;
`;
export const Dashboard = styled.div`

`;

export const Link = styled.div`
position: absolute;
width: 75px;
height: 24px;
left: 72px;
top: 124px;
font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 14px;
line-height: 24px;
/* identical to box height, or 171% */
color: #F0F1F5;
`;

export const Training = styled.div`

`;
export const Header = styled.div`
position: absolute;
width: 57px;
height: 24px;
left: 32px;
top: 188px;

font-family: 'Inter';
font-style: normal;
font-weight: 700;
font-size: 14px;
line-height: 24px;
/* identical to box height, or 171% */


color: #F0F1F5;
`;


export const Navigation: React.FC = () => {
    return (
        <Wrapper>
            <Dashboard>
                <img src={dashboard} />
                <Link>Dashboard</Link>
            </Dashboard>

            <Training>
                <Header>Training</Header>
                <Flex>
                    <img src={courses} />
                    <Link>Courses</Link>
                </Flex>
            </Training>
        </Wrapper>
    )
}
